import React from 'react';

const LoginNavigation = ({ onRouteChange, isSignedIn, onRollChange }) => {
		if (isSignedIn){
		return (
		<nav style={{display: 'flex', justifyContent: 'flex-end'}}>
		  <p onClick={() =>  onRouteChange('signout')} className='f5 link dib black underline pa3 pointer' > SignOut </p>
		  <p onClick={() =>  onRouteChange('userPage')} className='f5 link dib black underline pa3 pointer' > User </p>

		 </nav>
		 );
		} else if (onRouteChange === "userPage") {
		return (
			<nav style={{display: 'flex', justifyContent: 'flex-end'}}>
             <p onClick={() =>  onRouteChange('signout')} className='f5 link dib black underline pa3 pointer' > SignOut </p>
              <p onClick={() => onRollChange("rollAgain")} className='f5 center link dib black pa3 pointer' > Roll Again?</p>


		 </nav>
        );
	}

		else {
		return (
			<nav style={{display: 'flex', justifyContent: 'flex-end'}}>
		  <p onClick={() =>  onRouteChange('signin')} className='f5 link dib black underline pa3 pointer' > Sign in </p>
		  <p onClick={() =>  onRouteChange('register')} className='f5 link dib black underline pa3 pointer' > Register </p>
		 </nav>
        );
	}
}
export default LoginNavigation;
